import React, { Fragment } from "react";
import{button,Table} from 'react-bootstarp';
import"bootstarp/dist/css/bootstarp.min.css";
import Employee from './Employee';                       


function Home(){
    return (
        <Fragment>
            <div style={{margin:"10rem"}}>
                <Table striped bordered hover size="sm">
                    <thead>
                        <tr>
                            <th>
                                name
                            </th>
                            <th>
                                age
                            </th>
                        </tr>
                    </thead>
                    <tbody>
                        {
                            Employee && Employee.length>0
                            ?
                            Employee.map((item)=>{
                                return (
                                    <tr>
                                        <td>
                                            {item.Name}
                                        </td>
                                        <td>
                                            {item.Age}
                                        </td>
                                    </tr>
                                )
                            })
                            :
                            "No data Available"
                        }
                    </tbody>
                </Table>
            </div>
        </Fragment>
    )
}

export default Home;
